  return (
    <div className='cards'>
        <>
          {/* <p className='cards__message text_subtitle'>{''}</p> */}
          <div className='cards__list'>
              <MoviesCard />
              <MoviesCard />
              <MoviesCard />
          </div>

            <button className='cards__button text link'>
              Ещё
            </button>
        </>
    </div>
  );
}

export default MoviesCardList;
